const About = () => {
    return (
        <div>
            <h1>About</h1>
            <p>An innovative, goal-oriented and self-directed professional with a M.S. in Computer Science and B.S. in Mechanical Engineering (Aerospace Concentration) with relative experience in Systems and Software Engineering. 
                Adept at collaborating with engineering team to conceptualize and deliver quality work. Proficient in Python, Java, JavaScript, R, MySQL, ReactJS and Python Flask. 
                Superior work-ethic with outstanding analytical, project-management skills.</p>

        </div>
    )
}

export default About
